import React from 'react';

function Footer() {
  return (
    <footer style={{ backgroundColor: '#6A5ACD', color: '#FFFFFF', fontFamily: 'Jost, sans-serif', padding: '40px 20px' }}>
      <div style={{ maxWidth: '800px', margin: '0 auto', textAlign: 'center' }}>
        {/* IMFRA Title */}
        <h1 style={{ fontSize: '36px', fontWeight: 'bold', marginBottom: '10px' }}>IMFRA</h1>

        {/* Navigation Links */}
        <div style={{ fontSize: '20px', fontWeight: '400', lineHeight: '2' }}>
          <p>About Us</p>
          <p>Gallery</p>
          <p>Contact Us</p>
          <p style={{ fontSize: '16px', fontWeight: '300', marginTop: '10px' }}>+49 123 456 789</p>
        </div>

        {/* Social Icons */}
        <div style={{ marginTop: '20px', fontSize: '24px', display: 'flex', justifyContent: 'center', gap: '20px' }}>
          <a href="#" style={{ color: '#FFFFFF' }}>
            <i className="bi bi-instagram"></i>
          </a>
          <a href="#" style={{ color: '#FFFFFF' }}>
            <i className="bi bi-facebook"></i>
          </a>
          <a href="#" style={{ color: '#FFFFFF' }}>
            <i className="bi bi-envelope"></i>
          </a>
        </div>

        {/* Footer Note */}
        <div style={{ marginTop: '30px', fontSize: '14px', fontWeight: '300' }}>
          Â© IMFRA. All rights reserved.
        </div>
      </div>
    </footer>
  );
}

export default Footer;
